    return ( 
        <div className="favourites">
            {cart.map((data)=>(
                <div className="fav_book">
                    <img src={data.thumbnailUrl} alt="" />
                    <h4>{data.title}</h4>
                </div>
            ))}
        </div>
     );
}
 
